import React, { useState, useEffect } from 'react';
import serviceApi from './services/Api';
import Footer from './components/Footer.js';

const App = () => {
  const [drinks, setDrinks] = useState([]);

  useEffect(() => {
    serviceApi
    .getAll()
    .then(allDrinks => {
      setDrinks(allDrinks); // Update the state with the fetched drinks
      console.log(allDrinks);
    });
  }, []); // Empty dependency array since it's a one-time fetch

  return (
    <div>
      <p>Hello world</p>
      <drinkCard />
      <Footer />
    </div>
  );
};

export default App;
